I made this ~10 liner deep dict diff.<p>It&#x27;s an abomination but also kind of fun, useful for my project where I&#x27;m reverse engineering a deeply nested api.<p>```<p>def deep_diff(first, second):<p><pre><code>    &quot;&quot;&quot;~10 liner find the differences between deeply nested dictionaries.&quot;&quot;&quot;

    return {

        # recursive case

        k: deep_diff(v1, v2)

        # Base case, if this depth differs, return the diff.

        if isinstance(v1, dict) and isinstance(v2, dict)

        else {&quot;diff&quot;: diff, &quot;first&quot;: v1, &quot;second&quot;: v2}

        # Get the keys from both dictionaries at the same level of depth.

        for k in first.keys() | second.keys()

        # Test the differences at this depth level.

        for diff, v1, v2 in [

            (operator.ne(first.get(k), second.get(k)), first.get(k), second.get(k))

        ]

    }
</code></pre>
```<p>```<p>&gt;&gt;&gt; pprint(deep_diff(a,{*a, &#x27;hello&#x27;: None}))<p>{&#x27;hello&#x27;: {&#x27;diff&#x27;: True, &#x27;first&#x27;: {&#x27;chello&#x27;: 1}, &#x27;second&#x27;: None}}<p>&gt;&gt;&gt; pprint(deep_diff(a,{*a, &#x27;hello&#x27;: {&#x27;chello&#x27;: 1, &#x27;aloha&#x27;: 2}}))<p>{&#x27;hello&#x27;: {&#x27;aloha&#x27;: {&#x27;diff&#x27;: True, &#x27;first&#x27;: None, &#x27;second&#x27;: 2},<p><pre><code>           &#x27;chello&#x27;: {&#x27;diff&#x27;: False, &#x27;first&#x27;: 1, &#x27;second&#x27;: 1}}}

</code></pre>
```
